import React from "react";

const Cards = ({ result }) => {
  return (
    <div className="container">
      <img
        src={`http://image.tmdb.org/t/p/w185/` + result.poster_path}
        alt=""
      />
      <h3>{result.title}</h3>
    </div>
  );
};
export default Cards;
